import {Routes, Route, Navigate} from "react-router-dom"

export const Routescmp = () => {
  return (
    <div className="p-4 ">
      <Routes>
        <Route path="/" element={<Navigate from="/" to="/search" />}></Route>
      </Routes>
    </div>
  )
}
